dna = "".upper()
compliment = ""

for base in dna:
    if base == "A":
        compliment += "T"
    elif base == "T":
        compliment += "A"
    elif base == "C":
        compliment += "G"
    elif base == "G":
        compliment += "C"
    else: # in case of U
        compliment += "U" 

print(compliment[::-1])